import './App.css';
import Home from "../src/Components/Home"
import Admin from "../src/Components/Admin"


function App() {
  return (
    <div className="App">

      <BrowseRouter>
      <Routes>

        <Route path = "/" element = {<Home />} />
        <Route path = "/admin" element = {<Admin />} />


      </Routes>

      </BrowseRouter>
    </div>
  );
}

export default App;
